webpackJsonp([484],{"./node_modules/json-loader/index.js!./.cache/json/articles-meta-free-code-camp-honesty-policy.json":function(e,t){e.exports={data:{markdownRemark:{html:"<p>Before we issue our verified certificate to a camper, he or she must accept our Academic Honesty Pledge, which reads:</p>\n<ol>\n<li>\n<p>I understand that plagiarism means copying someone else's work and presenting the work as if it were my own, without clearly attributing the original author.</p>\n</li>\n<li>\n<p>I understand that plagiarism is an act of intellectual dishonesty, and that people usually get kicked out of university or fired from their jobs if they get caught plagiarizing.</p>\n</li>\n<li>\n<p>Aside from using open source libraries such as jQuery and Bootstrap, and short snippets of code which are clearly attributed to their original author, 100% of the code in my Algorithms, Back End Projects and Front End Projects was written by me or along with another camper with whom I was pair programming in real time.</p>\n</li>\n<li>\n<p>I pledge that I did not plagiarize any of my Free Code Camp work, and that I am OK with any random auditing Free Code Camp may do to confirm this.</p>\n</li>\n</ol>",frontmatter:{title:"Free Code Camp Honesty Policy",parent:"/home/stuart/guides/src/pages/articles/meta/free-code-camp-honesty-policy/index.md absPath of file"}}},pathContext:{slug:"/articles/meta/free-code-camp-honesty-policy/"}}}});
